class BankMd {  final int? id;  final String bankName;  final String accountNumber;  final String accountName;  final int masjidId;  final DateTime? createdAt;  BankMd({    this.id,    required this.bankName,    required this.accountNumber,    required this.accountName,    required this.masjidId,    this.createdAt,  });  factory BankMd.fromJson(Map<String, dynamic> json) {    return BankMd(      id: json['id'],      bankName: json['bank_name'],      accountNumber: json['acc_no'],      accountName: json['acc_name'],      masjidId: json['masjid_id'],      createdAt: json['created_at'] != null          ? DateTime.parse(json['created_at'])          : null,    );  }  Map<String, dynamic> toJson() {    return {      'id': id,      'bank_name': bankName,      'acc_no': accountNumber,      'acc_name': accountName,      'masjid_id': masjidId,      'created_at': createdAt?.toIso8601String(),    };  }}